Thupelo ena e u fa koetliso ea maemo a webo ea data le maemo a webo a semantic. O tla u tsebisa lipuo tse u lumellang:
- ho emela le ho phatlalatsa lintlha tse hokahaneng ho Websaete (RDF);
- ho botsa le ho khetha data ena ka nepo haholo u le hole le ka Web (SPARQL);
- emela mantsoe le ho beha mabaka le ho fumana lintlha tse ncha ho ntlafatsa litlhaloso tse hatisitsoeng (RDFS, OWL, SKOS);
- 'me qetellong, ho rera le ho latela histori ea data (VOiD, DCAT, PROV-O, joalo-joalo).
fomate
Thupelo ena e arotsoe ka libeke tse 7 + 1 bonase beke ka ho feletseng e nehetsoeng ho Dbpedia. Litaba li fumaneha ka botlalo ka mokhoa boitelo, ke hore, bula ka mokhoa oa nako e telele o u lumellang hore u hatele pele ka lebelo la hau. Tatelano eohle ea thupelo e hlahisa mehopolo ea thupelo e nang le litaba tse fapaneng tsa multimedia: livideo, lipotso, litemana le lihokelo tse ling + lipont≈°o tse ngata tse bonts'ang ts'ebeliso ea mekhoa e hlahisitsoeng. Qetellong ea beke e 'ngoe le e 'ngoe, ho fanoa ka boikoetliso le ho tebisa maikutlo.

Mask oa ho Buoa ka Bongaka
Li-mask tsa ho buoa tsa bongaka li na le khanyetso e nyane ea phallo ea moea, thibelo ea mali ea maiketsetso, ho sefa ha lintho tse itseng le libaktheria, ho thibela lelakabe le lit≈°obotsi tse ling;e fanoe ka sebopeho sa nyopa.khanyetsano ea phallo ea moea e ka tlase ho 49 Pa, ts'ebetso ea ho sefa ea baktheria e kholo ho feta 95.
Sehlahisoa se loketse t≈°ireletso ea motheo ea basebetsi ba tsa bongaka kapa basebetsi ba amanang le bona, hammoho le t≈°ireletso khahlanong le
... 
le moea oa pro-monness permeability;
