4.Sekoahelo sa nko sa 'mele oa mask oa polasetiki nakong ea ho apara phetoho e loketseng, ho apara ho phutholoha le ho phutholoha;
5.Ho hanyetsa ho phefumoloha ho tlase ho 49 Pa, nakong ea ho apara;
6.Sehlahisoa sena se sebelisa theknoloji ea khatiso e se nang moeli le theknoloji ea welding ea ultrasonic ho etsa hore mask a be
...
oba ho kopana ka letsoho le kahare ea mask, lehlakore le ka tlase la mask ho isa motsong oa selelu, lebanta la tsebe le let≈°ehali le lebanta le letona le leketlileng tsebeng;
3.U sebelisa polasetiki ea sekoaelo sa nko ea mask, tobetsa ka monoana, etsa hore sekotwana sa nko se khomarele ka holim'a sefate sa nko, u b≈çpe sekoahelo sa nko ho ea ka seb≈çpeho sa sefate sa nko, ebe u tsamaisa monoana oa letsoho mahlakoreng ka bobeli butle-butle, e le hore mask kaofela a be haufi le letlalo la sefahleho.
